  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains a unified GeoTiff
  with 10x10 meter cell size representing the slope (in degrees) of several deep coral
  priority areas off the South Atlantic Bight, derived from data collected in September
  2007. NOAA's NOS/NCCOS/CCMA Biogeography Branch, in collaboration with NOAA vessel
  Nancy Foster, as well as federal, university, and private sector partners, acquired
  multibeam bathymetry data off the South Atlantic Bight from 6/4/07 to 6/9/07. Data
  was acquired with a hull-mounted Kongsberg Simrad EM 1002 multibeam echosounder
  (95 kHz). It was processed by a NOAA contractor using CARIS HIPS software. Attitude
  and sound velocity correctors applied to the data. Verified tides were not applied
  to the data, leaving the depth values referenced to the ellipsoid. The imagery is
  projected in the UTM Zone 17 north, NAD83 datum. The processed CARIS data was used
  to generate a CARIS BASE surface based on swath angle. The CARIS Export option \"BASE
  Surface to Image\" was then used to create a GeoTiff of the priority areas. Slope
  was derived from this surface using the slope calculator, a function of ESRI's Spatial
  Analyst extension.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
